#include<iostream>
#include<vector>
#include<string>

using namespace std;

class Solution {
public:
    int two_longestCommonPrefix(string s1,string s2){
        int i=0,j=0;
        while(i<s1.size() && j<s2.size() && s1[i]==s2[j]){
            i++,j++;
        }
        if(i>0) 
            return i;
        else 
            return -1;
    }
    string longestCommonPrefix(vector<string>& strs) {
        if(strs.size()<=1) return strs[0];
        int r,min_len=strs[0].size()+1;
        for(int i=0;i<=strs.size()-2;i++){
            r = two_longestCommonPrefix(strs[i],strs[i+1]);
            if(r>0){
                if(r<min_len) min_len = r;
            }else{
                return "";
            }
        }
        return strs[0].substr(0,min_len);
    }
};

